@keyframes spinner {
  to {
    transform: rotate(360deg);
  }
}
@-webkit-keyframes spinner {
  to {
    -webkit-transform: rotate(360deg);
  }
}
.loading-spinner-large {
  min-width: 42px;
  min-height: 42px;
  display: block;
  position: relative;
}
.loading-spinner-large:before {
  content: '';
  position: absolute;
  top: 50%;
  left: 50%;
  width: 42px;
  height: 42px;
  margin-top: -21px;
  margin-left: -21px;
  border-radius: 50%;
  border: 2px solid #4a4f4f;
  border-top-color: #172626;
  animation: spinner 0.7s cubic-bezier(0.645, 0.045, 0.355, 1) infinite;
  -webkit-animation: spinner 0.7s cubic-bezier(0.645, 0.045, 0.355, 1) infinite;
}
